tinymce.PluginManager.add("textboxes",function(e){"use strict";function t(){var t=e.selection.getNode();e.windowManager.open({title:"Custom Textbox",body:{type:"textbox",name:"className",size:40,label:"Class",value:t.name||t.id},onsubmit:function(t){e.execCommand("mceReplaceContent",!1,'<div class="textbox '+t.data.className+'">{$selection}</div>')}})}e.addButton("textboxes",{type:"menubutton",text:"Textboxes",icon:!1,menu:[{text:"Standard",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox">{$selection}</div>')}},{text:"Shaded",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox shaded">{$selection}</div>')}},{text:"Learning Objective",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox learning-objective">{$selection}</div>')}},{text:"Key Takeaway",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox key-takeaway">{$selection}</div>')}},{text:"Exercise",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox exercise">{$selection}</div>')}},{text:"Example",onclick:function(){e.execCommand("mceReplaceContent",!1,'<div class="textbox example">{$selection}</div>')}},{text:"Custom...",onclick:function(){t()}}]})});